import { useState } from "react";

const Celebs = () => {
    //database
    let stars = [
        {
            img:"",
            name:"",
            id:1
        },
        {
            img:"",
            name:"",
            id:1
        },
        {
            img:"",
            name:"",
            id:1
        },
        {
            img:"",
            name:"",
            id:1
        },
        {
            img:"",
            name:"",
            id:1
        }
    ]
    return (
        <div className="celebs">
            {
                stars.map(data=>(
                    <div className="celebs_list">
                        <img src={data.img} alt="" />
                        <h1>{DataTransfer.name}</h1>
                    </div>
                )

                )
            }
        </div>
    );
}

export default Celebs;
